import MovieModule from "./MovieModule";
import React, { useEffect, useState } from "react";
import { List, Header, Rating } from "semantic-ui-react";

function Rated_Movies() {
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        fetch("/rated_movies").then(response =>
            response.json().then(data => {
                setMovies(data.movies);
            })
        );
    }, []);


    return (
        <div className='.f2 tc pa4'>
            <h1 id='title'>Rated Movies</h1>
            <List>
                {movies.map(movie => {
                    return (
                        <List.Item key={movie.title}>
                            <Header>{movie.title}</Header>
                            <Rating rating={movie.rating} maxRating={5} disabled />
                        </List.Item>
                    );
                })}
            </List>
        </div>
    )

    return movies.map((movie) => (
        <MovieModule key={movie.id} movie={movie} />
    ));
}

export default Rated_Movies;
